INSERT INTO `content_info` VALUES (1,1,'Our Story','Tamburlaine is Australia\'s largest producer of organic wines, although not a large ','http://54.67.111.151/pics/winery_info_pics/1_Tamburlaine/pics/content/OurStoryEnglish.htm'),(2,1,'Our Organic Approach','Our approach, we describe as `contemporary organics`, applies modern best practice in vineyard management. Our organic wines come from organically managed vineyards','http://54.67.111.151/pics/winery_info_pics/1_Tamburlaine/pics/content/Organic_English.htm');
