INSERT INTO `content_info_Chinese` VALUES (1,1,'帖木儿酒庄','帖木儿酒庄是获得澳大利亚有机种植及生产协会认证的酒庄，是精品葡萄酒业中有机种植和生产的先驱 ','http://54.67.111.151/pics/winery_info_pics/1_Tamburlaine/pics/content/OurStoryEnglish.htm'),(2,1,'有机种植方法','我们的方法，称之为“现代有机种植”，使用了现代葡萄园管理中最优的实践方法。我们的有机葡萄酒来自有机管理的葡萄园','http://54.67.111.151/pics/winery_info_pics/1_Tamburlaine/pics/content/Organic_English.htm');
