INSERT INTO `wine_basic_info_chinese` VALUES (3,'恋酒人 赤霞珠','帖木儿','澳大利亚新南威尔士奥兰治葡萄酒产区','http://54.67.111.151/pics/wine_info/wine3_2010_res_chamborcin/national_flag.png','黑醋栗， 草莓酱和森林地面的香气，丰富的混合浆果口味，持久的雪松橡木单宁的余韵。','搭配牛排和烤红肉菜肴，口味更佳。','可在低于20摄氏度环境下贮藏十年以上','烤牛排配意大利青酱#黑莓牛柳#亚式烤羊肉肋骨#苏格兰炖牛肉','http://54.67.111.151/pics/wine_info/wine3_2010_res_chamborcin/food_pair_pics/salsa_verde_steak.jpg#http://54.67.111.151/pics/wine_info/wine3_2010_res_chamborcin/food_pair_pics/beef_tenderloin_with_blackberry.jpg#http://54.67.111.151/pics/wine_info/wine3_2','奥兰治','澳大利亚海拔最高的葡萄酒产区,距离悉尼 4 个小 时车程。围绕死火山拉斯山,海拔870 米。肥沃的火山玄武岩土壤,结合四季分明的气候,在那个海拔高度,为生产带有优雅结构和强烈水果特色的葡萄酒提供了完美的平衡。这些酒包括:干白系列的莎当妮,雷司令和长相思;干红系列的赤霞珠,设拉子,梅乐,马贝克和由品丽珠和歌海娜混合酿成的酒,都非常适合高海拔气候,并带有显著特色,具有陈酿的潜力.','','http://54.67.111.151/pics/wine_info/wine3_2010_res_chamborcin/tamburlance_logo_white.png','100%有机／生物动力认证的的赤霞珠','http://54.67.111.151/pics/wine_info/wine3_2010_res_chamborcin/wine_3.png',2010),(2,'珍藏级 马贝克','帖木儿','澳大利亚新南威尔士奥兰治葡萄酒产区','http://54.67.111.151/pics/wine_info/wine2_2010_res_ormalbec/national_flag.png','黑莓和薄荷，花香以及雪松橡木气味。有野生浆果和果酱的味道，口感持久。','搭配格子烤的牛排或肋骨，或者搭配豆焖肉（炖的一种扁豆，里面放香肠，鸭肉或其它肉类）。也可搭配浓烈，成熟的切达奶酪。','可在低于20摄氏度的酒窖中储存十年以上','甜酱烤牛肋骨#中式番石榴烧烤酱排骨#黑椒巴法罗蓝乳酪汉堡','http://54.67.111.151/pics/wine_info/wine2_2010_res_ormalbec/food_pair_pics/beefribs.jpg#http://54.67.111.151/pics/wine_info/wine2_2010_res_ormalbec/food_pair_pics/guavabbq.jpg#http://54.67.111.151/pics/wine_info/wine2_2010_res_ormalbec/food_pair_pics/perf','奥兰治','澳大利亚海拔最高的葡萄酒产区,距离悉尼 4 个小 时车程。围绕死火山拉斯山,海拔870 米。肥沃的火山玄武岩土壤,结合四季分明的气候,在那个海拔高度,为生产带有优雅结构和强烈水果特色的葡萄酒提供了完美的平衡。这些酒包括:干白系列的莎当妮,雷司令和长相思;干红系列的赤霞珠,设拉子,梅乐,马贝克和由品丽珠和歌海娜混合酿成的酒,都非常适合高海拔气候,并带有显著特色,具有陈酿的潜力.','','http://54.67.111.151/pics/wine_info/wine1_2012_cabernet_merlot/tamburlance_logo_white.png','100%有机／生物动力认证的马贝克。 这款出自于奥兰治产区的收藏级马贝克由澳大利亚最高海拔地带种植的马贝克葡萄酿造而成，有低海拔地带葡萄没有的独特风格。','http://54.67.111.151/pics/wine_info/wine2_2010_res_ormalbec/wine_2.png',2010),(1,'勇士王子 卡本内梅乐','帖木儿','澳大利亚新南威尔士奥兰治葡萄酒产区','http://54.67.111.151/pics/wine_info/wine1_2012_cabernet_merlot/national_flag.png','黑醋栗的香气，香甜的浓缩深色浆果味，由层层精细的单宁支撑','蘑菇，帕玛森干酪，意大利烤鸡千层面，波隆那肉酱意大利面是非常好的搭配','可在低于20摄氏度环境下贮藏七年','picture 1#picture 2#picture 3','http://54.67.111.151/pics/wine_info/wine1_2012_cabernet_merlot/food_pair_pics/pic1_name_tbd.png#http://54.67.111.151/pics/wine_info/wine1_2012_cabernet_merlot/food_pair_pics/pic2_name_tbd.png#http://54.67.111.151/pics/wine_info/wine1_2012_cabernet_merlot/','奥兰治','澳大利亚海拔最高的葡萄酒产区,距离悉尼 4 个小 时车程。围绕死火山拉斯山,海拔870 米。肥沃的火山玄武岩土壤,结合四季分明的气候,在那个海拔高度,为生产带有优雅结构和强烈水果特色的葡萄酒提供了完美的平衡。这些酒包括:干白系列的莎当妮,雷司令和长相思;干红系列的赤霞珠,设拉子,梅乐,马贝克和由品丽珠和歌海娜混合酿成的酒,都非常适合高海拔气候,并带有显著特色,具有陈酿的潜力.','','http://54.67.111.151/pics/wine_info/wine1_2012_cabernet_merlot/tamburlance_logo_white.png','100%有机／生物动力认证的的赤霞珠和梅乐','http://54.67.111.151/pics/wine_info/wine1_2012_cabernet_merlot/wine_1.png',2012),(4,'勇士王子 设拉子','帖木儿','澳大利亚新南威尔士奥兰治葡萄酒产区','http://54.67.111.151/pics/wine_info/wine4_2012_shiraz/national_flag.png','成熟的红色浆果香味，丰富辛香的口感，柔滑的雪松橡木余韵。',' 搭配牛肉和羊肉，风味绝佳。','可在低于20摄氏度环境下贮藏七年以上','烤羊肉#烤牛排#炖牛肉#烤牛腩','http://54.67.111.151/pics/wine_info/wine4_2012_shiraz/food_pair_pics/pic1_tbd.jpg#http://54.67.111.151/pics/wine_info/wine4_2012_shiraz/food_pair_pics/beef_stew.jpg#http://54.67.111.151/pics/wine_info/wine4_2012_shiraz/food_pair_pics/beef_brisket.jpg#http','奥兰治','澳大利亚海拔最高的葡萄酒产区,距离悉尼 4 个小 时车程。围绕死火山拉斯山,海拔870 米。肥沃的火山玄武岩土壤,结合四季分明的气候,在那个海拔高度,为生产带有优雅结构和强烈水果特色的葡萄酒提供了完美的平衡。这些酒包括:干白系列的莎当妮,雷司令和长相思;干红系列的赤霞珠,设拉子,梅乐,马贝克和由品丽珠和歌海娜混合酿成的酒,都非常适合高海拔气候,并带有显著特色,具有陈酿的潜力.','','http://54.67.111.151/pics/wine_info/wine1_2012_cabernet_merlot/tamburlance_logo_white.png','100%有机／生物动力认证的设拉子','http://54.67.111.151/pics/wine_info/wine4_2012_shiraz/wine_4.png',2012);
