INSERT INTO `wine_basic_info_english` VALUES (1,'Warrior Prince Cabernet Merlot','Tamburlaine','Orange, NSW, Australia','http://54.67.111.151/pics/wine_info/wine1_2012_cabernet_merlot/national_flag.png','<TBD>Rich dried fruit, blackberry and vanillin oak; concentrated palate of wild berries with mocha tones and a long velvet-soft finish.','<TBD>A perfect match to veal and pasta dishes.','7 years in a cell < 20 C','picture 1#picture 2#picture 3 ','http://54.67.111.151/pics/wine_info/wine1_2012_cabernet_merlot/food_pair_pics/pic1_name_tbd.png#http://54.67.111.151/pics/wine_info/wine1_2012_cabernet_merlot/food_pair_pics/pic2_name_tbd.png#http://54.67.111.151/pics/wine_info/wine1_2012_cabernet_merlot/food_pair_pics/pic3_name_tbd.png#http://54.67.111.151/pics/wine_info/wine1_2012_cabernet_merlot/food_pair_pics/pic4_name_tbd.png','Orange Wine Region','The Orange Wine Region\'s high altitude regions provide us with long slow ripening and extended fruit hang time; so important in developing true varietal characters and flavors. The volcanic red soils of our vineyards are ideal for growing complex Merlot with well balanced tannin structure and full fruit flavor.','','http://54.67.111.151/pics/wine_info/wine1_2012_cabernet_merlot/tamburlance_logo_white.png','100% Organically Certificated Cabernet & Merlot','http://54.67.111.151/pics/wine_info/wine1_2012_cabernet_merlot/wine_1.png',2012),(2,'Reserve Malbec','Tamburlaine','Orange, NSW, Australia','http://54.67.111.151/pics/wine_info/wine2_2010_res_ormalbec/national_flag.png','The wine\'s aroma is characterized by blackberry, mint and floral hints with supporting cedary oak. Wild berries and jam persist on the palate.','The wine is perfect to grilled steak, ribs, or other meat stew with beans. It goes well with sharp cheddar cheese too.','More than 10 years in a cell < 20 C','Sticky Barbecued Beef Ribs#Chinese-Style Ribs with Guava Barbeque Sauce#Black Pepper Buffalo Burgers with Blue Cheese','http://54.67.111.151/pics/wine_info/wine2_2010_res_ormalbec/food_pair_pics/beefribs.jpg#http://54.67.111.151/pics/wine_info/wine2_2010_res_ormalbec/food_pair_pics/guavabbq.jpg#http://54.67.111.151/pics/wine_info/wine2_2010_res_ormalbec/food_pair_pics/perfect-blue-cheese-burger-by-mikko-kuhna.jpg','Orange Wine Region','The Orange Wine Region\'s high altitude regions provide us with long slow ripening and extended fruit hang time; so important in developing true varietal characters and flavors. The volcanic red soils of our vineyards are ideal for growing complex Merlot with well balanced tannin structure and full fruit flavor.',' ','http://54.67.111.151/pics/wine_info/wine2_2010_res_ormalbec/tamburlance_logo_white.png','100% Organically Certified Malbec.The Reserve Malbec from the Orange region comes from some of the highest altitude Malbec vines in Australia, resulting in a truly unique style of wine rarely seen from downunder. ','http://54.67.111.151/pics/wine_info/wine2_2010_res_ormalbec/wine_2.png',2010),(3,'Wine Lovers Cabernet Sauvignon','Tamburlaine','Orange, NSW, Australia','http://54.67.111.151/pics/wine_info/wine3_2010_res_chamborcin/national_flag.png','Blackcurrant, strawberry jam and forest floor aromas. Rich mixed berry palate with persistent cedary oak tannin finish.','It goes well with almost any meat -- lamb, beef, smoked meats. It can also be paired with French, American, firm cheeses like aged cheddar and hard cheeses like Pecorino.','7 years in a cell < 20 C','Grilled Steak with Salsa Verde#Beef Tenderloin with Blackberry#Asian BBQ Lamb#Scottish Beef Stew','http://54.67.111.151/pics/wine_info/wine3_2010_res_chamborcin/food_pair_pics/salsa_verde_steak.jpg#http://54.67.111.151/pics/wine_info/wine3_2010_res_chamborcin/food_pair_pics/beef_tenderloin_with_blackberry.jpg#http://54.67.111.151/pics/wine_info/wine3_2010_res_chamborcin/food_pair_pics/asian_bbq_ribs.jpg#http://54.67.111.151/pics/wine_info/wine3_2010_res_chamborcin/food_pair_pics/scottish_beef_stew.png','Orange Wine Region','The Orange Wine Region\'s high altitude regions provide us with long slow ripening and extended fruit hang time; so important in developing true varietal characters and flavors. The volcanic red soils of our vineyards are ideal for growing complex Merlot with well balanced tannin structure and full fruit flavor.',' ','http://54.67.111.151/pics/wine_info/wine3_2010_res_chamborcin/tamburlance_logo_white.png','100% Organically Certificated Cabernet Sauvignon','http://54.67.111.151/pics/wine_info/wine3_2010_res_chamborcin/wine_3.png',2010),(4,'Warrior Prince Shiraz','Tamburlaine','Orange, NSW, Australia','http://54.67.111.151/pics/wine_info/wine4_2012_shiraz/national_flag.png','<TBD>Rich dried fruit, blackberry and vanillin oak; concentrated palate of wild berries with mocha tones and a long velvet-soft finish.','<TBD>A perfect match to veal and pasta dishes.','7 years in a cell < 20 C','picture 1#picture 2#picture 3#picture 4 ','http://54.67.111.151/pics/wine_info/wine4_2012_shiraz/food_pair_pics/pic1_tbd.jpg#http://54.67.111.151/pics/wine_info/wine4_2012_shiraz/food_pair_pics/beef_stew.jpg#http://54.67.111.151/pics/wine_info/wine4_2012_shiraz/food_pair_pics/beef_brisket.jpg#http://54.67.111.151/pics/wine_info/wine4_2012_shiraz/food_pair_pics/london_broil_whole.jpg','Orange Wine Region','The Orange Wine Region\'s high altitude regions provide us with long slow ripening and extended fruit hang time; so important in developing true varietal characters and flavors. The volcanic red soils of our vineyards are ideal for growing complex Merlot with well balanced tannin structure and full fruit flavor.',' ','http://54.67.111.151/pics/wine_info/wine4_2012_shiraz/tamburlance_logo_white.png','100% Organically Certificated Shiraz','http://54.67.111.151/pics/wine_info/wine4_2012_shiraz/wine_4.png ',2012);
